import ExpenseItem from './ExpenseItem';
import Card from '../UI/Card';

export default function Expenses({ expenses }) {
	return (
		<Card>
			expenses.map(expense =>
			<ExpenseItem
				key={expenses.id}
				id={expenses.id}
				title={expenses.title}
				amount={expenses.amount}
				date={expenses.date}
			/>
		</Card>
	);
}
